import React, { Component } from 'react';
import styled from 'styled-components';

const Container = styled.div`
background-color:var(--Section-color);
display:inline-block;
border-radius: 0px 10px 0px 0px;
padding: 5px 5px;
position:absolute;
bottom:0px;
`

const Anchor = styled.a`
text-decoration:none;
color:white;
margin:15px 5px;
&:hover{
    color:var(--secondary-color);

  }
`
const Hide = styled.a`
display:none;
`
class Footer extends Component {
    render() { 
        return ( 

            <Container>



                               <Anchor href="" class="icon" alt="instagram"> <Hide>insta</Hide><i class="fa fa-instagram"></i></Anchor>

                                <Anchor href="" class="icon" alt="facebook"><Hide>Facebook</Hide><i class="fa fa-facebook-square"></i></Anchor>




            </Container>

         );
    }
}

export default Footer ;
